import React, {useState} from "react";
import "bootstrap/dist/css/bootstrap.min.css";
import Axios from "axios";


function CustomerSignup () {

  const[name,setName]=useState("");
  const[email,setEmail]=useState("");
  const[password,setPassword]=useState("");

  const customerSignup = () => {
    Axios.post("http://localhost:3001/CustomerSignup", {
      name:name,
      email:email,
      password:password
    }).then (() => {
      alert("Successfully Inserted");
    })
  }

  return(
      <div>
      <h1 className="customer-heading">Uber <span className="heading-eats">Eats</span></h1>
      <h1 className="form-floating">Customer SignUp</h1>
      <div className="form-floating">
       <input type="text" className="form-control" id="floatingName" placeholder="John Doe" name="name" onChange={(e) =>{
         setName(e.target.value);
       }} />
       <label htmlFor="floatingName">Name</label>
      </div>
      <div class="form-floating mb-3">
       <input type="email" class="form-control" id="floatingInput" placeholder="name@example.com" name="email" onChange={(e) => {
         setEmail(e.target.value);
       }} />
       <label htmlFor="floatingInput">Email address</label>
      </div>
      <div class="form-floating">
       <input type="password" class="form-control" id="floatingPassword" placeholder="Password" name="password" onChange={(e) =>{
         setPassword(e.target.value);
       }} />
       <label htmlFor="floatingPassword">Password</label>
       </div>
       <div class="d-grid gap-2 form-floating">
       <button onClick={customerSignup} type="button" class="btn btn-outline-primary">Continue</button>
       </div>
      </div>
  );
}



export default CustomerSignup;
